import React, { Component } from 'react';
import logo from './logo.svg';
import styled from "styled-components";

class App extends Component {
  render() {

  const Hero_main_background= styled.div`
  height: 743.9px;
  background-image: linear-gradient(322deg, #ff986a, #ff986a 30%, #ffd46a);


`

 const Hero_top_left_square = styled.div`
 width: 200px;
 height: 216px;
 background-image: linear-gradient(35deg, #ffd46a, #f9cb68);
 float: left;
`

const Hero_top_right_square = styled.div`
width: 900px;
height: 216px;
background-image: linear-gradient(-90deg, #DEA005 0%, #FFD46A 0%);
`

const Hero_rotate_top_two_squares = styled.div`
-ms-transform: rotate(-10deg); /* IE 9 */
-webkit-transform: rotate(-10deg); /* Safari */
transform: rotate(-10deg); /* Standard syntax */
position:absolute;
top: -155px;
left: -53px;
`

const Hero_bottom_left_square = styled.div`
width: 447.3px;
height: 186.4px;
background-color: rgba(255, 212, 106, 0.33);
left: -53px;
top: 560px;
`

const Hero_div_bottom_right_white = styled.div`
height: 300px;
width: 2000px;
background-color: white;
position: absolute;
z-index: 0;
`

const Hero_div_group2 = styled.div`
-ms-transform: rotate(-10deg); /* IE 9 */
-webkit-transform: rotate(-10deg); /* Safari */
transform: rotate(-10deg); /* Standard syntax */
`


    return (
      <div >
      <Hero_main_background>
       <Hero_rotate_top_two_squares>
       <Hero_top_left_square/>
       <Hero_top_right_square/>
       </Hero_rotate_top_two_squares>
       <Hero_bottom_left_square/>
       <Hero_div_bottom_right_white/>

      </Hero_main_background>
      </div>
    );
  }
}

export default App;
